import React, { useState } from 'react';
import {  TextField, Button, Typography } from '@mui/material';
import regimg from "../component/assets/regester.png"
import instalogo from "../component/assets/instagram-logo.png";
import FacebookIcon from '@mui/icons-material/Facebook';
import Divider from '@mui/material/Divider';
import { Link } from "react-router-dom";
import axios from 'axios';

function RegisterPage() {
  const [userData, setUserData] = useState({
    username: "",
    email: "",
    password: "",
  });



  const handleSubmit = (e) => {
    e.preventDefault();

    // Ensure that all required fields are provided
    if (userData.username && userData.email && userData.password) {
      // Make the POST request here
      axios.post("http://16.170.173.197/users/signup", userData)
        .then((response) => {
          console.log(response.data);
        })
        .catch((error) => {
          console.error(error);
        });
    } else {
      // Handle validation or display an error message to the user
      console.error('All fields are required');
    }
  };  





  axios.post('http://16.170.173.197/users/signup',userData)
  .then((response)=>{
    console.log(response)
  })
  .catch((error) => {
    console.error('AxiosError:', error);
  });
  return (
    <div className='regpage'>
       <img src={regimg} alt="" className="regimg"/>

      <form onSubmit={handleSubmit} className="regform">
      <img id="insta" src={instalogo} alt="instalogo" width={"100px"} />
      <Typography
      sx={{color:"gray",fontWeight:"100px"}}
      >Sign up to see photos and videos from your friends</Typography>
      <Button
      sx={{textTransform:'capitalize'}}
        variant="contained"
        color="secondary"
        startIcon={<FacebookIcon />}
      >
        Sign Up with Facebook
      </Button>
      <Link id="but" to="/login">

<Button
sx={{marginTop:1}}
type="submit"
variant="contained"
color="primary"
size="small"
>
Login 
</Button></Link>
      <Divider sx={{width:"100%"}}>or</Divider>


        <TextField
        sx={{width:360,backgroundColor:'white',borderRadius:1}}
        label="UserName"
        name="username"
          variant="filled"
          margin="normal"
          size="small"
          value={userData.username}
          onChange={(e)=>{
            setUserData({...userData,username:e.target.value})}}
        />

        <TextField

        sx={{width:360,backgroundColor:'white',borderRadius:1}}
        label="Email"
        name="email"
          variant="filled"
          margin="normal"
          size="small"
          value={userData.email}
          onChange={(e)=>{
            setUserData({...userData,email:e.target.value})}}        />
        <TextField
          fullWidth
          sx={{width:360,backgroundColor:'white',borderRadius:1}}
          label="Password"
          name="password"
            variant="filled"
            margin="normal"
            type="password"
            size="small"
          value={userData.password}
          onChange={(e)=>{
            setUserData({...userData,password:e.target.value})}}        />
        <Button

          type="submit"
          variant="contained"
          color="secondary"
          size="large"
          sx={{ mt: 2 }}
        >
          Register
        </Button>

      </form>
      </div>   );
}

export default RegisterPage;
